import {Component, Input, OnInit} from '@angular/core';
import {FormBuilder, FormGroup, UntypedFormGroup, Validators} from '@angular/forms';
import { MarketplaceApiService } from 'src/app/core/marketplace-api/marketplace-api.service';
import { OfferModel } from 'src/app/core/marketplace-api/models/offer.model';

@Component({
  selector: 'app-offer-creation',
  templateUrl: './offer-creation.component.html',
  styleUrls: ['./offer-creation.component.scss']
})
export class OfferCreationComponent implements OnInit {

  offerForm: UntypedFormGroup;

  @Input()
  categories: string[];
  form: FormGroup;

  constructor(private formBuilder: FormBuilder, public markeplaceApiService: MarketplaceApiService) {

  }
  ngOnInit(): void {
    this.form = this.formBuilder.group({
      title: ['', Validators.required],
      picture: ['', Validators.required],
      description: ['', Validators.required],
      location: ['', Validators.required],
      category: ['', Validators.required]
    });
  }

  onSubmit() {
    if (this.form.valid) {
      const offer =  new OfferModel();
      offer.category.id = this.form.value.category;

      this.markeplaceApiService.addOffer(this.form.value)
      console.log(this.form.value);
    } else {
      // Mostrar mensajes de error o realizar acciones adicionales
    }
  }
}
<form [formGroup]="form" (ngSubmit)="onSubmit()">
  <div class="form-group">
    <label for="title">Título</label>
    <input type="text" class="form-control" id="title" formControlName="title">
    <div *ngIf="form.get('title').invalid && form.get('title').touched" class="text-danger">
      <div *ngIf="form.get('title').errors?.required">El título es requerido</div>
    </div>
  </div>
  <div class="form-group">
    <label for="picture">Imagen</label>
    <input type="text" class="form-control" id="picture" formControlName="picture">
    <div *ngIf="form.get('picture').invalid && form.get('picture').touched" class="text-danger">
      <div *ngIf="form.get('picture').errors?.required">La imagen es requerida</div>
    </div>
  </div>
  <div class="form-group">
    <label for="description">Descripción</label>
    <textarea class="form-control" id="description" formControlName="description"></textarea>
    <div *ngIf="form.get('description').invalid && form.get('description').touched" class="text-danger">
      <div *ngIf="form.get('description').errors?.required">La descripción es requerida</div>
    </div>
  </div>
  <div class="form-group">
    <label for="location">Ubicación</label>
    <input type="text" class="form-control" id="location" formControlName="location">
    <div *ngIf="form.get('location').invalid && form.get('location').touched" class="text-danger">
      <div *ngIf="form.get('location').errors?.required">La ubicación es requerida</div>
    </div>
  </div>
  <div class="form-group">
    <label for="category">Categoría</label>
    <select class="form-control" id="category" formControlName="category">
      <option value="">Seleccione una categoría</option>
      <option value="category1">Categoría 1</option>
      <option value="category2">Categoría 2</option>
      <option value="category3">Categoría 3</option>
    </select>
    <div *ngIf="form.get('category').invalid && form.get('category').touched" class="text-danger">
      <div *ngIf="form.get('category').errors?.required">La categoría es requerida</div>
    </div>
  </div>
  <button type="submit" class="btn btn-primary" [disabled]="form.invalid">Enviar</button>
</form>
